import React from 'react';
import { Swiper, SwiperSlide } from 'swiper/react';
import 'swiper/swiper-bundle.css';

// Import Swiper styles
import 'swiper/swiper.min.css';
import 'swiper/components/pagination/pagination.min.css';
import 'swiper/components/effect-coverflow/effect-coverflow.min.css';

// Import Swiper and required modules
import SwiperCore, { EffectCoverflow, Pagination, Keyboard, Mousewheel } from 'swiper';

SwiperCore.use([EffectCoverflow, Pagination, Keyboard, Mousewheel]);

const EventSlider = () => {
  const events = [
    {
      id: 1,
      category: 'domestic',
      title: 'Enjoy the exotic of sunny Hawaii',
      location: 'Maui, Hawaii',
      image: 'https://images.unsplash.com/photo-1556206079-747a7a424d3d?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=871&q=80',
    },
    // Add other events
  ];

  return (
    <section>
      <Swiper
        effect="coverflow"
        grabCursor={true}
        centeredSlides={true}
        slidesPerView="auto"
        coverflowEffect={{
          rotate: 0,
          stretch: 0,
          depth: 100,
          modifier: 2,
          slideShadows: true,
        }}
        keyboard={{ enabled: true }}
        mousewheel={{ thresholdDelta: 70 }}
        spaceBetween={60}
        loop={true}
        pagination={{ clickable: true }}
      >
        {events.map((event) => (
          <SwiperSlide
            key={event.id}
            style={{
              backgroundImage: `linear-gradient(to top, #0f2027, #203a4300, #2c536400), url(${event.image}) no-repeat 50% 50% / cover`,
            }}
            className={`swiper-slide swiper-slide--${event.category}`}
          >
            <span>{event.category}</span>
            <div>
              <h2>{event.title}</h2>
              <p>
                <svg
                  xmlns="http://www.w3.org/2000/svg"
                  fill="none"
                  viewBox="0 0 24 24"
                  stroke-width="1.5"
                  stroke="currentColor"
                  className="w-6 h-6"
                >
                  <path stroke-linecap="round" stroke-linejoin="round" d="M15 10.5a3 3 0 11-6 0 3 3 0 016 0z" />
                  <path
                    stroke-linecap="round"
                    stroke-linejoin="round"
                    d="M19.5 10.5c0 7.142-7.5 11.25-7.5 11.25S4.5 17.642 4.5 10.5a7.5 7.5 0 1115 0z"
                  />
                </svg>
                {event.location}
              </p>
            </div>
          </SwiperSlide>
        ))}
      </Swiper>
    </section>
  );
};

export default EventSlider;
